import React from "react";
import Widget from "components/Widget/index";
import { Divider,Col,Row } from "antd";

const Doctors = ({doctorList}) => {

  return (
    <Widget title="Associated Doctors" styleName="gx-card-profile-sm">
      <div className="gx-pt-2">
          {doctorList.map((doctor, index) => {
                return (
                  <div key={index}>
                   <Row>
              <Col xl={18} lg={24} md={24} sm={12} xs={24}>
              <div className="col-auto ">
                      <div className="last-message-time">{doctor.name}</div>              
                    </div>
                      <span className="name h6">{doctor.discipline}</span>
                      <p className="last-message text-truncate gx-text-muted">{doctor.email}</p>
              </Col>
              <Col xl={6} lg={24} md={24} sm={12} xs={24}>
              <p className="gx-text-primary gx-text-truncate gx-mt-sm-auto gx-mb-0 gx-pointer">View</p>
              </Col>
            </Row>
            <Divider/>
                  </div>
                  
                );
             
            }
          )}
        <p className="gx-text-primary gx-mb-2"><i className="icon icon-add-circle gx-fs-lg gx-d-inline-flex gx-vertical-align-middle"/> Add New Claim</p>

      </div>
    </Widget>
  )
}
export default Doctors
